import React, { useState, useEffect } from 'react';
import { useHistory, useParams } from 'react-router-dom';

const ProductEditScreen = () => {
  const history = useHistory();
  const { id } = useParams();
  return (
    <div>
      <h1>Product Edit Screen</h1>
      <h2>{id}</h2>
    </div>
  );
};

export default ProductEditScreen;
